USE `zber`;

/*Table structure for table `images` */

DROP TABLE IF EXISTS `images`;

CREATE TABLE `images` (
  `id` varchar(64) NOT NULL COMMENT '图片表id标识',
  `full_path` varchar(1024) DEFAULT NULL COMMENT '图片完整路径，全路径',
  `storage_path` varchar(255) DEFAULT NULL COMMENT '图片存储路径',
  `custom_name` varchar(255) DEFAULT NULL COMMENT '图片自定义名称',
  `old_name` varchar(1024) DEFAULT NULL COMMENT '图片原名称',
  `suffix` varchar(10) DEFAULT NULL COMMENT '图片后缀',
  `setId` varchar(64) DEFAULT NULL COMMENT '图片归属；项目id，轮播图id,商铺商品表id,用户id,openid',
  `imgUrl` varchar(1024) DEFAULT NULL COMMENT '图片url，访问路径',
  `navigator` varchar(255) DEFAULT NULL COMMENT '图片跳转地址path',
  `remark` text COMMENT '图片描述',
  `state` int(11) DEFAULT '0' COMMENT '状态,0=正常,1=停用',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(64) DEFAULT 'admin' COMMENT '创建人',
  `modify` varchar(64) DEFAULT 'admin' COMMENT '修改人',
  `version` varchar(64) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='图片表';

